public:
  information_schema:
    role_column_grants:
      type: view
      view_sql: " SELECT grantor,\n    grantee,\n    table_catalog,\n    table_schema,\n\
        \    table_name,\n    column_name,\n    privilege_type,\n    is_grantable\n\
        \   FROM information_schema.column_privileges\n  WHERE (grantor::name IN (\
        \ SELECT enabled_roles.role_name\n           FROM information_schema.enabled_roles))\
        \ OR (grantee::name IN ( SELECT enabled_roles.role_name\n           FROM information_schema.enabled_roles));"
      schema:
        grantor: varchar(64)
        grantee: varchar(64)
        table_catalog: varchar(64)
        table_schema: varchar(64)
        table_name: varchar(64)
        column_name: varchar(64)
        privilege_type: varchar(256)
        is_grantable: varchar(256)
      pg_types:
        grantor: name
        grantee: name
        table_catalog: name
        table_schema: name
        table_name: name
        column_name: name
        privilege_type: varchar
